import React from 'react';

let a = 0;
let b = 0;

function Math() {
    return ( 
        <h1>Math</h1>
    );
    
}

export default Math

function add(a, b) {
    return ( a + b );
}

function sub(a, b) {
    return ( a - b );
}

function div(a, b) {
    return ( a / b );
}

function mult(a, b) {
    return ( a * b );
}


export {add, sub, div, mult};
